import React from 'react';
import '../css/navproductos.css' 
const productos = [
  'Boxer sin costuras',
  'Boxer sin costura',
  'Boxer microfibra deportivo',
  'Boxer algodón premium',
  'Boxer mezcla stretch',
  'Boxer compresión ligera',
  'Boxer algodón clásico',
];

const NavProductos = () => {
  return (
    <nav className="bg-gray-100 p-4 shadow">
      <ul className="flex flex-wrap gap-4 justify-center">
        {productos.map((nombre, index) => (
          <li key={index}>
            <a
              href={`#${nombre.toLowerCase().replace(/\s+/g, '-').replace(/ñ/g, 'n')}`}
              className="text-sm font-semibold text-gray-700 hover:text-blue-600 transition"
            >
              {nombre}
            </a>
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default NavProductos;
